import React, { useState } from 'react';
import {Carousel, Card} from 'react-bootstrap';
import img1 from '../components/projects/Consepril.png';
import img2 from '../components/projects/Ecommerce.png';
import img3 from '../components/projects/DaySchedule.png';
import img4 from '../components/projects/HoriseonWebsite.png';
import img5 from '../components/projects/NoteTaker.png';
import img6 from '../components/projects/ParotaDelCarmen.png';
import img7 from '../components/projects/PassGen.png';
import img8 from '../components/projects/Quiz.png';
import img9 from '../components/projects/WeatherDash.png';




function Projects() {
return(
    <section>
        <h3 style={{justifyContent:'center'}}>Projects</h3>
        <Card.Body>
    <Carousel>
    <Carousel.Item>
      <img
        className="d-block w-100"
        src={img1}
        alt="First slide"
      />
      <Carousel.Caption>
        <h3>Consepril</h3>
        <p>Developed a website for a Private Security Company to be deployed in 2022.</p>
      </Carousel.Caption>
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="d-block w-100"
        src={img2}
        alt="Ecommerce"
      />

      <Carousel.Caption>
        <h3>Insomnia BackEnd Ecommerce</h3>
        <p>Developed the back end for an e-commerce site by modifying starter code. Configurations were made to Express.js API to use Sequelize to interact with a MYSQL database.</p>
      </Carousel.Caption>
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="d-block w-100"
        src="holder.js/800x400?text=Third slide&bg=20232a"
        alt="Third slide"
      />

      <Carousel.Caption>
        <h3>Third slide label</h3>
        <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
      </Carousel.Caption>
    </Carousel.Item>
  </Carousel>
  </Card.Body>
  </section>
)
}

export default Projects;
